import React, { Component } from 'react'
import { connect } from 'react-redux'
import FollowedUser from './FollowedUser';

export class FollowedUserList extends Component {
  render() {
    return (
        <>
            {this.props.followerList.map((username, index) => (
                <FollowedUser key={index} username = {username} headline = {this.props.headline}/>
            ))}
        </>
    )
  }
}

const mapStateToProps = (state) => {
    return {
        followingList: state.riceZoneApp.followerList,
        headline: state.riceZoneApp.defaultHeadLine
    }
  };

